--Creating and selecting database
use master; 
go

if DB_ID('Tienda_en_linea') is not null
drop database Tienda_en_linea;
go
CREATE DATABASE Tienda_en_linea;
go

SET DATEFORMAT dmy;  
GO 

use Tienda_en_linea;
go

--Creating tables for database
if OBJECT_ID ('cliente') is not null drop table cliente;
create table cliente(--insert
    id_cliente int identity not null,
    nombre_cliente varchar(50),
    direccion_cliente varchar(50),
    telefono_cliente char(20)
);
go
if OBJECT_ID ('factura') is not null drop table factura;
create table factura(--insert
    id_factura int identity not null,
    id_tienda int not null,
    id_cliente int not null,
    id_empleado int not null,
    cantidad_factura numeric(8,0),
    fecha date,
    descripcion_factura varchar(25)
);
go


if OBJECT_ID ('factura_producto') is not null drop table factura_producto;
create table factura_producto(--insert
	id_factura_producto int identity not null primary key,
    id_producto int not null,
    id_factura int not null,
    cantidad_producto numeric(8,0)
);
go


if OBJECT_ID ('producto') is not null drop table producto;
create table producto(--insert
    id_producto int identity not null,
    nombre_producto varchar(100),
    descripcion_producto varchar(500),
    cantidad_disponible numeric(8,0)
);
go
if OBJECT_ID ('empleado') is not null drop table empleado;
create table empleado(--insert
    id_empleado int identity not null,
    nombre_empleado varchar(50),
    direccion_empleado varchar(150),
    telefono_empleado varchar(15)
);
go
if OBJECT_ID ('proveedor_producto') is not null drop table proveedor_producto;
create table proveedor_producto(
	proveedor_producto int identity not null primary key,
    id_producto int not null,
    id_proveedor int not null
);
go

if OBJECT_ID ('proveedor') is not null drop table proveedor;
create table proveedor(--insert
    id_proveedor int identity not null,
    nombre_proveedor varchar(100),
    direccion_proveedor varchar(150),
    telefono_proveedor varchar(15)
);
if OBJECT_ID ('tienda') is not null drop table tienda;
create table tienda(--insert
	id_tienda int identity not null,
	nombre_tienda varchar(50),
	direccion_tienda varchar(100),
	telefono_tienda varchar(15)
);
go
--Adding data to tables

--Index creation
create clustered index I_cliente_nombre_cliente on cliente(nombre_cliente);
create clustered index I_factura_codigo on factura(cantidad_factura);
create nonclustered index I_producto_nombre_producto on producto(nombre_producto);
create nonclustered index I_empleado_nombre on empleado(nombre_empleado);
create nonclustered index I_proveedor_nombre on proveedor(nombre_proveedor);


--Primary key creation
alter table cliente
	add constraint PK_cliente_idcliente primary key (id_cliente);
alter table factura
	add constraint PK_factura_idfactura primary key (id_factura);
alter table tienda
	add constraint PK_tienda_idtienda primary key (id_tienda); 
alter table producto 
	add constraint PK_id_producto primary key (id_producto);
alter table empleado
	add constraint PK_id_empleado primary key (id_empleado);
alter table proveedor
	add constraint PK_id_proveedor primary key (id_proveedor);

--Foreign Key
alter table factura
	add constraint FK_factura_cliente foreign key(id_cliente) references cliente(id_cliente) on update cascade on delete cascade,
	constraint Fk_factura_tienda foreign key(id_tienda) references tienda(id_tienda) on update cascade on delete cascade,
	constraint FK_factura_empleado foreign key(id_empleado) references empleado(id_empleado) on update cascade on delete cascade;
go

alter table factura_producto 
	add constraint FK_facturaproducto_producto foreign key(id_producto) references producto(id_producto) on update cascade on delete cascade,
	constraint FK_facturaproducto_factura foreign key(id_factura) references factura(id_factura) on update cascade on delete cascade;
go

alter table proveedor_producto
	add constraint FK_proveedor_producto_id_producto foreign key(id_producto) references producto(id_producto) on update cascade on delete cascade,
	constraint FK_proveedor_producto_id_proveedor foreign key(id_proveedor) references proveedor(id_proveedor) on update cascade on delete cascade;
go

--Visualization of orderable index columns
exec sp_helpindex cliente;
exec sp_helpindex factura;
exec sp_helpindex producto;
exec sp_helpindex empleado;
exec sp_helpindex proveedor;

--list all constraints defined on a table along with their user_defined or system-supplied name.
exec sp_helpconstraint cliente;
exec sp_helpconstraint factura;
exec sp_helpconstraint producto;
exec sp_helpconstraint empleado;
exec sp_helpconstraint proveedor;

--list all indexes user and non-user created
select name from sysindexes;

--list all indexes user created
select name from sysindexes where name like 'I_%';


